lution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":28.57142857142857,\"y\":2.9703911411054604,\"width\":40,\"height\":7.128938738653106,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3 style=\\\"text-align:center\\\"><strong>Center of Gravity</strong></h3>\\n\"},\"subContentId\":\"58138a83-59a6-4104-b625-1027c68c23f2\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.5037593984962405,\"y\":79.30944346751579,\"width\":96.98781954887218,\"height\":20.792737987738224,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>First, the object is pushed slowly along the surface of a table towards an edge.<br />\\nAt the point where the object is just about to fall, a line is drawn parallel to the table edge.<br />\\nThe procedure is repeated with the object rotated \\\\(90^\\\\circ\\\\).<br />\\nThe intersection point of the two lines gives the location of the center of gravity.</p>\\n\"},\"subContentId\":\"863d2b24-9775-48bb-8859-66e18b8bdbde\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":0,\"y\":8.91117342331638,\"width\":98.49624060150376,\"height\":14.851955705527303,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>There are a couple of useful methods that can be applied to determine the center of gravity of irregularly shaped bodies.Â </p>\\n\"},\"subContentId\":\"b3475083-006d-474f-a5e0-7b8018907ed1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled T 11173423316383,\"width\":45.11278195488722,\"height\":91.08437098997196,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>In common usage, the mass of an object is often referred to as its weight. However, these are different concepts and quantities.</p>\\n\\n<ul>\\n\\t<li>Mass is the quantity of matter in a body. It is measured in kg in SI. While, weight is the force exerted by gravity (gravitational field strength) on the body.</li>\\n\\t<li>Weight changes with location, while mass stays constant.</li>\\n</ul>\\n\\n<p>The variation in weight is due to the fact that the gravitational field strength varies between different locations.</p>\\n\\n<p>For instance, the gravitational field strength on Earth is around 10 N/kg, while it is 1.6 N/kg on the moon and 0 N/kg in space. This explains the variation in the weight of a body between the different locations.</p>\\n\"},\"subContentId\":\"4590e220-889a-4a04-b533-97c6af3f79b7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":29.411764705882355,\"y\":2.1575624722213833,\"width\":40,\"height\":8.91117342331638,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3 style=\\\"text-align:center\\\"><strong>Gravitational Field Strength</strong></h3>\\n\"},\"subContentId\":\"687f2662-bde7-4a23-952c-5b1d62882390\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0893246187363834,\"y\":21.57562472221383,\"width\":69.71677559912854,\"height\": \":730},\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"subContentId\":\"1be01156-691c-46ae-abe6-f2dfb36af971\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":71.67755991285402,\"y\":21.57562472221383,\"width\":27.233115468409586,\"height\":58.25418674997735,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>For example:</p>\\n\\n<ul>\\n\\t<li>Jupiter is the planet with the highest mass, thus it has the highest gravitational field strength.</li>\\n\\t<li>Mercury is the planet with the lowest mass, thus it has the lowest gravitational field strength.</li>\\n</ul>\\n\"},\"subContentId\":\"489d51d7-4705-4b0b-9567-b8662c092366\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0893246187363834,\"y\":12.9453748333283,\"width\":98.91067538126362,\"height\":8.630249888885533,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The gravitational field strength on the different planets is affected by the mass of the planet.</p>\\n\\n<p><strong>In general, the higher the mass of the planet, the higher its gravitational field strength.</strong></p>\\n\"},\"subContentId\":\"9f586941-cd3b-4c80-8887-8b0a8324cfd2\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"soluti
